import{_ as a,o as e,c as n,R as t}from"./chunks/framework.zUbWieqp.js";const k=JSON.parse('{"title":"war 升级步骤","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Linux/Jenkins/install/2-war_update.md","filePath":"guide/Linux/Jenkins/install/2-war_update.md","lastUpdated":1720606881000}'),s={name:"guide/Linux/Jenkins/install/2-war_update.md"},i=t('<h1 id="war-升级步骤" tabindex="-1">war 升级步骤 <a class="header-anchor" href="#war-升级步骤" aria-label="Permalink to &quot;war 升级步骤&quot;">​</a></h1><p>war 下载包</p><p><a href="https://www.jenkins.io/doc/book/installing/" target="_blank" rel="noreferrer">https://www.jenkins.io/doc/book/installing/</a></p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202407092229302.jpg" alt="war"></p><p>进入WAR File分区，点击其中的latest stable Jenkins WAR file即可下载最新版稳定war包</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202407092230338.jpg" alt="war1"></p><p>然后按照Jenkins的安装方式，我们分为以下两种情况：</p><p>打开tomcat下的webapps目录，找到Jenkins目录，将其剪切后，粘贴到桌面</p><p>将刚刚下载好的Jenkins.war放在tomcat下的webapps目录下，重启Tomcat即可。 重启后Jenkins.war会自动解压，我们再打开Jenkins就会看到已经更新为最新版了</p><p><strong>Jenkins直接用msi文件部署到本地的</strong></p><p>删除Jenkins/war目录下的所有文件，并把刚刚下载好的Jenkins.war包解压，将其中的文件放入Jenkins/war目录。最后重启一下Jenkins</p><p>1.解压到war目录下，删除原有</p><p>jar xvf jenkins.war</p><p>升级结束之后，提示Jenkins升级后提示java.lang.IllegalStateException: An attempt to save the global configuration was made before it was loaded</p><p><strong>解决方式</strong></p><ol><li><p>下载role-strategy.hpi，下载地址：<a href="https://updates.jenkins.io/download/plugins/role-strategy/" target="_blank" rel="noreferrer">https://updates.jenkins.io/download/plugins/role-strategy/</a></p></li><li><p>将role-strategy.hpi复制到jenkins安装目录的plugins目录下面</p></li><li><p>重启jenkins的服务</p></li></ol>',16),r=[i];function p(o,l,c,d,_,g){return e(),n("div",null,r)}const u=a(s,[["render",p]]);export{k as __pageData,u as default};
